import React, { createRef, useEffect } from "react";
import Diagram from "devextreme-react/diagram";
import "whatwg-fetch";

export const DiagramEditor = (props) => {
  const diagramRef = createRef();

  useEffect(() => {}, []);

  const onInitialized = () => {
    //alert("Diagram initialized");
  };

  return (
    <Diagram
      id="diagram"
      ref={diagramRef}
      onInitialized={onInitialized}
      showGrid={true}
      snapToGrid={false}
      pageOrientation={"landscape"}
      width={100}
      height={50}
      pageWidth={10}
      {...props}
    />
  );
};
